import React from 'react'



function LogoWithAbreviation(props) {
    return (
        <svg
            xmlns="http://www.w3.org/2000/svg"
            xlink="http://www.w3.org/1999/xlink"
            style={{marginRight: 0}}
            {...props}>
            <image x="0px" y="0px" {...props} href="data:img/png;base64," />
        </svg>
    )
}
export default LogoWithAbreviation;